var mouseDownStart, mouseDownInterval, scrollInterval, scrollbarActive, elemToScroll, resizeEndTimer, sI;

function startMouseDownTimer(fallback) {
  mouseDownStart = Date.now();
  mouseDownInterval = setInterval(function() {
    let elapsedTime = Date.now() - mouseDownStart;
    if (elapsedTime.toFixed() > 700) {
      fallback();
      clearInterval(mouseDownInterval);
      mouseDownStart = mouseDownInterval = void 0;
    }
  }, 100);
}
document.addEventListener('mouseup', function() {
  clearInterval(scrollInterval);
  clearInterval(mouseDownInterval);
  elemToScroll && (document.body.style.userSelect = '');
  elemToScroll = scrollbarActive = scrollInfo = void 0;
});
document.addEventListener('mousemove', function(e) {
  scrollbarActive && (elemToScroll[sI.dir] = sI.scroll + (sI.size * (e[sI.edir] - sI.client)) / (sI.offset - 40));
});

function generateScrollbars() {
  document.querySelectorAll('.scroller').forEach(function(a) {
    let overflowX = a.scrollWidth > a.clientWidth,
      overflowY = a.scrollHeight > a.clientHeight,
      overflowXY = overflowX && overflowY;
    overflowXY && a.parentNode.classList.add('scrollbar--both');

    function scrollHand(f, dir) {
      let distance = 200 /* add an equation for speed proportional to content */
      a[f] += dir * distance
      startMouseDownTimer(function() {
        scrollInterval = setInterval(function() {
          a[f] += dir * distance
        }, 50);
      })
    };
    if (overflowY) {
      var nativeScrollbarW = a.offsetWidth - a.clientWidth,
        initialPaddingR = window.getComputedStyle(a, null).getPropertyValue('padding-right');
      a.style.paddingRight = parseFloat(initialPaddingR) + 21 - nativeScrollbarW + 'px';
      let newbarY = document.createElement('div'),
        buttUpY = document.createElement('div'),
        buttDownY = document.createElement('div'),
        scrollbarY = document.createElement('div');
      newbarY.className = 'scrollbar--vertical';
      buttUpY.className = 'scrollbar__button scrollbar__button--up'
      buttDownY.className = 'scrollbar__button scrollbar__button--down'
      scrollbarY.className = 'scrollbar__lift'
      newbarY.appendChild(buttUpY);
      newbarY.appendChild(buttDownY);
      newbarY.appendChild(scrollbarY);
      a.parentNode.appendChild(newbarY);
      buttUpY.addEventListener('mousedown', function(e) {
        scrollHand('scrollTop', -1)
      });
      buttDownY.addEventListener('mousedown', function(e) {
        scrollHand('scrollTop', 1)
      });
      scrollbarY.addEventListener('mousedown', function(e) {
        scrollbarActive = this;
        elemToScroll = this.closest('.window-body').querySelector('.scroller');
        sI = {
          client: e.clientY,
          scroll: elemToScroll.scrollTop - elemToScroll.getBoundingClientRect().top,
          dir: 'scrollTop',
          offset: elemToScroll.offsetHeight - 40,
          size: elemToScroll.scrollHeight,
          edir: 'screenY'
        };
        document.body.style.userSelect = 'none'
      });

      var offsetHeightY = a.offsetHeight - 38 - (overflowXY ? 38 : 0);
      var scrollbarHeight = Math.max(30, (offsetHeightY / a.scrollHeight) * a.offsetHeight);
      scrollbarY.style.height = Math.ceil(scrollbarHeight) + 'px';

      var xH = offsetHeightY / a.scrollHeight;
      a.addEventListener('scroll', function() {
        scrollbarY.style.top = xH * a.scrollTop + 'px'
      });
    }
    if (overflowX) {
      var nativeScrollbarH = a.offsetHeight - a.clientHeight,
        initialPaddingB = window.getComputedStyle(a, null).getPropertyValue('padding-bottom');
      a.style.paddingBottom = parseFloat(initialPaddingB) + 21 - nativeScrollbarH + 'px'
      let newbarX = document.createElement('div'),
        buttUpX = document.createElement('div'),
        buttDownX = document.createElement('div'),
        scrollbarX = document.createElement('div');
      newbarX.className = 'scrollbar--horizontal';
      buttUpX.className = 'scrollbar__button scrollbar__button--up'
      buttDownX.className = 'scrollbar__button scrollbar__button--down'
      scrollbarX.className = 'scrollbar__lift'
      newbarX.appendChild(buttUpX);
      newbarX.appendChild(buttDownX);
      newbarX.appendChild(scrollbarX);
      a.parentNode.appendChild(newbarX);
      buttUpX.addEventListener('mousedown', function(e) {
        scrollHand('scrollLeft', -1)
      });
      buttDownX.addEventListener('mousedown', function(e) {
        scrollHand('scrollLeft', 1)
      });
      scrollbarX.addEventListener('mousedown', function(e) {
        scrollbarActive = this;
        elemToScroll = this.closest('.window-body').querySelector('.scroller');
        sI = {
          client: e.clientX,
          scroll: elemToScroll.scrollLeft - elemToScroll.getBoundingClientRect().left,
          dir: 'scrollLeft',
          offset: elemToScroll.offsetWidth - 40,
          size: elemToScroll.scrollWidth,
          edir: 'screenX'
        };
        document.body.style.userSelect = 'none'
      });

      var offsetWidthX = a.offsetWidth - 38 - (overflowXY ? 38 : 0);
      var scrollbarWidth = Math.max(30, (offsetWidthX / a.scrollWidth) * a.offsetWidth);
      scrollbarX.style.width = Math.ceil(scrollbarWidth) + 'px';

      var xW = offsetWidthX / a.scrollWidth;
      a.addEventListener('scroll', function() {
        scrollbarX.style.left = xW * a.scrollLeft + 'px'
      });
    }
  });
}
var tooltip;
document.addEventListener('mouseover', function(e) {
  let t = e.target;
  u = t.closest('.sub-menu-item');
  if (u) {
    setTimeout(function() {
      var top = e.pageY,
        left = e.pageX;
      tooltip = generateElement({
        tag: 'div',
        appendIn: document.body,
        style: `top:${top}px;left:${left}px;opacity:1`,
        attribs: {
          class: 'tooltip',
        },
        content: u.getAttribute('data-tooltip')
      });
    }, 500);

  }

});
